import React, { useState, useEffect } from 'react';
import './../../Utils/Dashboard/style.css';
import './../../Utils/Dashboard/css/header.css';
import './../../Utils/Dashboard/css/bootstrap.min.css';
import goal from '../../images/goal.png';
import planning from './../../images/planning.png';
import subscription from "./../../images/subscription.png"
import invitation from './../../images/invitation.png'
import payment_method1 from './../../images/payment-method1.png'
import shout from './../../images/shout.png'
import today1 from "./../../images/today1.png";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";



function SideMenu() {

    return (
        <div class="col-lg-3 col-md-4 col-11 mx-auto dashbord-menu">
            <ul>

                <li class="active"><Link to='/'><span><img src={goal} class="img-fluid" alt="" /></span>My goal</Link></li>
                <li><Link to='/profile'><span><img src={today1} class="img-fluid" alt="" /></span>My Profile</Link></li>
                <li><Link to='/currentPlan'><span><img src={planning} class="img-fluid" alt="" /></span>current plan</Link></li>
                <li><Link to="/subscription"><span><img src={subscription} class="img-fluid" alt="" /></span>Subscription</Link></li>
                <li><Link to="/invite"><span><img src={invitation} class="img-fluid" alt="" /></span>Invite guest user</Link></li>
                <li><Link to="mypayment"><span><img src={payment_method1} class="img-fluid" alt="" /></span>my payment history</Link></li>
                <li><Link to="/workout"><span><img src={shout} class="img-fluid" alt="" /></span>My workout program</Link></li>
            </ul>
        </div>
    )
}
export default SideMenu;
